import React, { useRef } from "react";
import { FaBars, FaTimes } from "react-icons/fa";

function Navbar() {
  const nav = useRef();
  const showNavbar = () => {
    console.log("Show navbar called");
    nav.current.classList.toggle("responsive_nav");
  };

  function myFunction(){
  var x = document.getElementById("myLinks");
  if (x.style.display === "block") {
    x.style.display = "none";
  } else {
    x.style.display = "block";
  }
  }

  return (
    <div>
      <div className="container" id="container">
        <div className="header">
          <img className="doglogo push" src="/doglogo.png" alt="logo"></img>

          <div id="myLinks">
            <button className="loginn">Login</button>
            <button className="signupp">Sign Up</button>
          </div>

          <button className="hamburger_menu" onClick={myFunction}><FaBars /></button>
        </div>
      </div>
    </div>
  );
}

export default Navbar;
